import React from 'react';

const MovieWithDeleteButton = ({ title, onDelete }) => {
  const handleDelete = () => {
    onDelete(title);
  };

  return (
    <div className="movie-with-delete">
      <span>{title}</span>
      <button onClick={handleDelete}>X</button>
    </div>
  );
};

export default MovieWithDeleteButton;
